using System;\nusing System.IO;\nusing System.Net;\nusing System.Text;\n\npublic class WebServiceClient\n{\n    private static string ReadResponseStream(Stream responseStream)\n    {\n        using (StreamReader reader = new StreamReader(responseStream, Encoding.UTF8))\n        {\n            return reader.ReadToEnd();\n        }\n    }\n\n    public static void MakeRequest(string sessionID, string websiteUrl, string serviceUrl)\n    {\n        // Set up the cookie container with the session ID\n        CookieContainer myContainer = new CookieContainer();\n        myContainer.Add(new Cookie("ASP.NET_SessionId", sessionID, "/", new Uri(websiteUrl).Host));\n\n        // Prepare the web request\n        HttpWebRequest request = (HttpWebRequest)WebRequest.Create(serviceUrl);\n        request.ContentType = "text/xml; charset=utf-8";\n        request.Method = "POST";\n        request.Accept = "text/xml";\n        request.Headers.Add("SOAPAction", "http://detectent.net/doneScreenScore");\n        request.CookieContainer = myContainer;\n\n        // Create the SOAP request\n        string soapRequest = @"<?xml version=""1.0"" encoding=""utf-8""?>\n                                <soap12:Envelope xmlns:xsi=""http://www.w3.org/2001/XMLSchema-instance""\n                                                 xmlns:xsd=""http://www.w3.org/2001/XMLSchema""\n                                                 xmlns:soap12=""http://www.w3.org/2003/05/soap-envelope"">\n                                    <soap12:Body>\n                                        <doneScreenScore xmlns=""http://detectent.net/"">\n                                            <input1>string</input1>\n                                            <input2>string</input2>\n                                            <input3>string</input3>\n                                            <input4>string</input4>\n                                        </doneScreenScore>\n                                    </soap12:Body>\n                                </soap12:Envelope>";\n\n        // Write the SOAP request to the request stream\n        using (Stream stream = request.GetRequestStream())\n        {\n            byte[] data = Encoding.UTF8.GetBytes(soapRequest);\n            stream.Write(data, 0, data.Length);\n        }\n\n        // Execute the request and get the response\n        using (HttpWebResponse response = (HttpWebResponse)request.GetResponse())\n        {\n            using (Stream resStream = response.GetResponseStream())\n            {\n                if (resStream != null)\n                {\n                    string responseFromWebServiceCall = ReadResponseStream(resStream);\n                    Console.WriteLine(responseFromWebServiceCall);\n                }\n            }\n        }\n    }\n\n    public static void Main()\n    {\n        // Replace with your actual session ID, website URL, and service URL\n        string sessionID = "your_session_id";\n        string websiteUrl = "http://example.com";\n        string serviceUrl = "http://example.com/webservice";\n\n        MakeRequest(sessionID, websiteUrl, serviceUrl);\n    }\n}